"use strict";

var O2_TABS = {
  open: function open(instance, tabId) {
    var tabsContainer = $(instance).parents('._tabs-container');
    var openedTab = $(tabsContainer).find('.g-tab[data-tab-id="' + tabId + '"]');
    if ($(openedTab).hasClass('g-tab_open')) return false;
    $(tabsContainer).find('.g-tab.g-tab_open').fadeOut(200, function () {
      $('.g-tab').removeClass('g-tab_open');
      $(openedTab).fadeIn(200).addClass('g-tab_open');
    });
    this.markActiveTab(instance);
  },
  markActiveTab: function markActiveTab(activeItem) {
    $('.g-tabs__item').each(function (index, item) {
      if ($(item).hasClass('g-tabs__item_active')) $(item).removeClass('g-tabs__item_active');
      $(activeItem).addClass('g-tabs__item_active');
    });
  }
};

